import React from "react";
// import { useState } from "react";
import addition from "./addition";
import subtraction from "./subtraction";
import multiplication from "./multiplication";
import division from "./division";

function Calculator() {
  // const addition = () => {};
  // const subtraction = () => {};
  // const multiplication = () => {};
  // const division = () => {};

  // const [value, setvalue]=useState("value");
  return (
    <div className=" 2xl:container border-4 text-3xl  m-4  bg-teal-400">
      <addition></addition>
      <subtraction></subtraction>
      <multiplication></multiplication>
      <division></division>




      <div >
        {/* <input type="input"></input> */}
        <div className="display-flex px-4 py-3 h-50% w-80% text-20px border-radius-5">

<button class="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm font-medium text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 group-hover:from-cyan-500 group-hover:to-blue-500 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800">
<span class="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0">
Cyan to blue
</span>
</button>
          <button className="btnz">AC</button>
          <button>+/-</button>
          <button>%</button>
          <button onClick={division}>/</button>
        </div>
        <div>
          <button>7</button>
          <button>8</button>
          <button>9</button>
          <button onClick={multiplication}>x</button>
        </div>
        <div>
          <button>4</button>
          <button>5</button>
          <button>6</button>
          <button onClick={subtraction}>-</button>
        </div>
        <div>
          <button>1</button>
          <button>2</button>
          <button>3</button>
          <button onClick={addition}>+</button>
        </div>
        <div>
          <button colSpan={2}>0</button>
          <button>.</button>
          <button>=</button>
        </div>
      </div>
    </div>
  );
}
export default Calculator;
